import React from 'react';
import { Link } from 'react-router-dom';
import s from './ramenhome.module.scss';


const Ramenhome = () => {
    return (
        <section className="container__main_dark">
            <div className={s.ramenhome}>
                <div className="subtitle">le ramen du moment</div>
                <h2>flaming hot tornado ramen</h2>
            </div>
        </section>
    );
  };

  export default Ramenhome;
